export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},DcDYzaf4YP:{data:{id:426,attributes:{imdbId:"tt0112579",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNmRiZDZkN2EtNWI5ZS00ZDg3LTgyNDItMWI5NjVlNmE5ODJiXkEyXkFqcGdeQXVyMjQwMjk0NjI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.6\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"69\u002F100"}],item_lang:{data:{id:1089,attributes:{title:e,plot:"The path of Francesca Johnson's (Meryl Streep's) future seems destined when an unexpected fork in the road causes her to question everything she had come to expect from life. While her husband and children are away at the Illinois State Fair in the summer of 1965, Robert Kincaid (Clint Eastwood) happens to turn into the Johnson farm and asks Francesca for directions to Roseman Bridge. Francesca later learns that he was in Iowa on assignment from National Geographic Magazine. She is reluctant seeing that he's a complete stranger, and then she agrees to show him to the bridges and gradually she talks about her life from being a war-bride from Italy which sets the pace for this bittersweet and all-too-brief romance of her life. Through the pain of separation from her secret love and the stark isolation she feels as the details of her life consume her, she writes her thoughts of the four-day love affair which took up three journals. The journals are found by her children after the lawyer was going over Francesca's will and all of the contents which produces a key to her hope chest in the bedroom which contained some of hers and Robert's things. The message they take from the diaries is to what you what you have to do to be happy in life. After learning that Robert Kincaid's cremated remains were scattered off Roseman Bridge and that their mother requested that she too be cremated and her ashes to be scattered off Roseman Bridge, the children must decide whether to honor their mother's final wishes or bury her alongside their father as the family had planned. Adapted from the novel by Robert James Waller, this is the story of a special love that happens just once in a lifetime, if you're lucky.",slug:"the-bridges-of-madison-county"}}},books:{data:[{id:3497,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:f,subtitle:b}},{id:3498,attributes:{title:l,description:"A special edition, in slipcase, limited to 1500 copies, numbered and signed by the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8X1bAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2002-01-01",publisher:"John m Hardy Publishing Company",subtitle:"An Epilogue to The Bridges of Madison County"}},{id:3499,attributes:{title:"Old Songs in a New Cafe",description:"From Robert James Waller comes a wonderful collection of 19 essays--all of them as romantic, reflective, and timeless as readers have come to expect from the author of The Bridges of Madison County--a celebration of life and loss, of what things still can be.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4fM5AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2009-09-26",publisher:f,subtitle:"Selected Essays"}},{id:3500,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:f,subtitle:b}},{id:3501,attributes:{title:l,description:b,thumbnail:b,authors:[a],firstBook:d,published:"2002-07-01",publisher:b,subtitle:"An Epilogue to the Bridges of Madison County"}}]}}},meta:{}}},prerenderedAt:1682568388264}}("Robert James Waller","","movie",null,"The Bridges of Madison County","Hachette UK","series",1,"Fall in love with one of the bestselling novels of all time -- the legendary love story that became a beloved film starring Clint Eastwood and Meryl Streep. If you've ever experienced the one true love of your life, a love that for some reason could never be, you will understand why readers all over the world are so moved by this small, unknown first novel that they became a publishing phenomenon and #1 bestseller. The story of Robert Kincaid, the photographer and free spirit searching for the covered bridges of Madison County, and Francesca Johnson, the farm wife waiting for the fulfillment of a girlhood dream, The Bridges of Madison County gives voice to the longings of men and women everywhere -- and shows us what it is to love and be loved so intensely that life is never the same again.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eb03AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2001-03-15","A Thousand Country Roads"))